/* #Peter River Flat Button
==================================================*/
.peter-box {
    margin-top: 20px;
}

.peter-button {
    position: relative;
    vertical-align: top;
    width: 100%;
    height: 50px;
    padding: 0 10px;
    margin-top: 10px;
    font-size: 1.2em;
    color: white;
    text-align: center;
    text-shadow: 0 1px 2px rgba(0, 0, 0, 0.25);
    background: #3498db;
    border: 0;
    border-radius: 5px;
    border-bottom: 2px solid #2a8bcc;
    cursor: pointer ;
    -webkit-box-shadow: inset 0 -2px #2a8bcc;
    box-shadow: inset 0 -2px #2a8bcc;
}
.peter-button:active {
    top: 1px;
    outline: none;
    -webkit-box-shadow: none;
    box-shadow: none;
}

.hide {
    display: none;
}
